import React from "react";
import classes1Image from "../gym/assets/classes-1.jpg";

const Classes = () => {
  const imag = [
    { icon: icon1, title: "Healthy Lifestyle", description: "Embrace a healthy lifestyle..." },
    { icon: icon2, title: "Body & Mind Balance", description: "Cultivate a strong, flexible body..." },
    { icon: icon3, title: "Meditation Practice", description: "Discover inner serenity..." },
    { icon: icon4, title: "Self-Care", description: "Transformative power of self-care..." }
  ];
  return (
    <section className="section__container classes__container" id="classes">
      <p className="section__subheader">YOGA CLASSES</p>
      <h2 className="section__header">Choose Your Level & Focus</h2>
      <div className="classes__grid">
        <div className="classes__image">
          {imag.map((img,index))}
          <img src={classes1Image} alt="classes" />
          <div className="classes__content">
            <button className="btn classes__btn">View More</button>
          </div>
        </div>
        {/* Repeat for other classes */}
      </div>
    </section>
  );
};

export default Classes;
